pragma solidity ^0.8.17;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./BCTypes.sol";

interface GamesInterface {
    function startGame(
        uint[] memory _playerIndexes,
        uint _numPlayers,
        uint _debugRoomId
    ) external returns (uint);
}

interface CharacterInterface {
    function ownerOf(uint256 tokenId) external view returns (address);

    function characters(
        uint256 charId
    ) external view returns (BCTypes.Character memory);

    function approve(address to, uint256 tokenId) external;
}

interface PlayersInterface {
    function addPlayer(
        uint _charId,
        address _owner,
        uint[] memory _itemIds
    ) external returns (uint);
}

contract Lobby is Ownable {
    GamesInterface games;
    CharacterInterface chars;
    PlayersInterface players;

    function setGameContract(
        address _gameContractAddress,
        address _charContractAddress,
        address _playersContractAddress
    ) public onlyOwner {
        games = GamesInterface(_gameContractAddress);
        chars = CharacterInterface(_charContractAddress);
        players = PlayersInterface(_playersContractAddress);
    }

    // uint public MIN_PLAYERS = 3;
    uint constant MAX_PLAYERS = 4;

    BCTypes.Lobby[] public lobbies;

    mapping(address => uint[]) public addressToLobbies;

    event StartedGame(uint indexed lobbyNumber, uint[] playerIds);
    event EnlistedMultiPlayer(uint indexed lobbyNumber, uint charId);
    event EnlistedSoloPlayer(uint indexed gameNumber, uint charId);

    constructor() {
        // Create the first lobby
        _addLobby();
    }

    function _addLobby() internal {
        BCTypes.Lobby storage newLobby = lobbies.push();
        newLobby.gameStarted = false;
        newLobby.numberOfPlayers = 0;
        newLobby.playerIndexes = new uint[](MAX_PLAYERS);
    }

    function enlistForMission(
        uint _charId,
        address charOwner,
        uint[] memory _itemIds
    ) public {
        require(msg.sender == address(chars), "Not character contract");
        // TODO: Create any variant for single player?  Maybe with full party?
        // TODO: and/ or decide on private lobbies
        // TODO: Reimplement getting char address for multiple contracts allowed
        // NOTE: Deliberately not attempting to prevent multi-enlist by one person
        // NOTE: Don't need to check for character ownership/status because of NFT transfer in chars.enlistChar()

        // Create lobby if needed
        BCTypes.Lobby storage newLobby;
        if (lobbies[lobbies.length - 1].numberOfPlayers == MAX_PLAYERS) {
            _addLobby();
        }

        newLobby = lobbies[lobbies.length - 1];

        // TODO: Validate and Lock item NFTs in contract

        uint playerIndex = players.addPlayer(_charId, charOwner, _itemIds);
        newLobby.playerIndexes[newLobby.numberOfPlayers] = playerIndex;
        newLobby.numberOfPlayers++;

        if (newLobby.numberOfPlayers == MAX_PLAYERS) {
            uint gameStarted = games.startGame(
                newLobby.playerIndexes,
                MAX_PLAYERS,
                0
            ); // TODO: Remove debug
            emit StartedGame(gameStarted, newLobby.playerIndexes);
        }

        addressToLobbies[msg.sender].push(lobbies.length - 1);
        emit EnlistedMultiPlayer(lobbies.length - 1, _charId);
    }

    // TODO: DRY and or validate if this needs a lobby or should be elsewhere
    function enlistSolo(
        uint _charId,
        address charOwner,
        uint[] memory _itemIds
    ) public {
        require(msg.sender == address(chars), "Not character contract");

        uint playerIndex = players.addPlayer(_charId, charOwner, _itemIds);
        uint[] memory player = new uint[](1);
        player[0] = playerIndex;
        uint gameStarted = games.startGame(player, 1, 0); // TODO: Remove debug
        emit EnlistedMultiPlayer(gameStarted, _charId);
        emit StartedGame(gameStarted, player);
    }

    function extGetLobbyPlayerIndexes(
        uint _lobbyId
    ) public view returns (uint[] memory) {
        uint[] memory indexes = new uint[](
            lobbies[_lobbyId].playerIndexes.length
        );
        for (uint i = 0; i < indexes.length; i++) {
            indexes[i] = lobbies[_lobbyId].playerIndexes[i];
        }
        return indexes;
    }
}
